import sys

def heaven():
    result_dic = {}
    check_num_lis = []
    for i in range(5):
        check_num = card_lis[0]
        if not check_num in check_num_lis:
            for card in card_lis[1:]:
                if card == check_num:
                    if not card in result_dic:
                        result_dic[card] = 2
                    else:
                        result_dic[card] = result_dic[card] + 1
            check_num_lis.append(check_num)
        card_lis.append(check_num)
        del card_lis[0]

    suicide(result_dic)

