    result = result_dic.values()
    result.sort()
    if result == [2]:
        print 'one pair'
    elif result == [2,2]:
        print 'two pair'
    elif result == [3]:
        print 'three card'
    elif result == [4]:
        print 'four card'
    elif result == [2,3]:
        print 'full house'
    elif not result:
        card_lis.sort()
