            print 'straight'
        else:
            check_num = card_lis[0]
            for card in card_lis:
                if card == check_num:
                    check_num = card + 1
                else:
                    print 'null'
                    break
            else:
                print 'straight'

for input_line in sys.stdin:
    card_lis = [int(char) for char in input_line.split(',')]
    heaven()

